import {
  MainContent,
  StyledMainMiddlesSection,
  MainSocialIcons,
  SocialIcon,
} from "../styles/MainMiddleSection.styled";
import { ResumeButton } from "../styles/Resume.styled";
import { FaGithub, FaLinkedin } from "react-icons/fa";

export const MainMiddleSection = () => {
  return (
    <StyledMainMiddlesSection>
      <MainContent>
        <h1>Parisa Heyd</h1>
        <h3>Front-End Web Developer</h3>
        <p>Javascript - Ruby - React - Next.js - Node.js - HTML - css</p>
        <div>
          <ResumeButton class="project" href="projects">
            Projects
          </ResumeButton>
          {/* <ResumeButton href="contact" primary margin="0 0 0  ">
            Hire Me
          </ResumeButton> */}
        </div>
      </MainContent>
      <MainMiddleSection>
        <SocialIcon href="#" target="_blank">
          <FaGithub />
        </SocialIcon>

        <SocialIcon href="#" target="_blank">
          <FaLinkedin />
        </SocialIcon>
      </MainMiddleSection>
    </StyledMainMiddlesSection>
  );
};
